#include <iostream>
#include <vector>
using namespace std;

void bucketSort(int arr[], int n) {
    // Find maximum element
    int maxVal = arr[0];
    for (int i = 1; i < n; i++) {
        if (arr[i] > maxVal)
            maxVal = arr[i];
    }

    // Create buckets
    vector<vector<int>> buckets(n);

    // Put elements into buckets
    for (int i = 0; i < n; i++) {
        int bucketIndex = (arr[i] * n) / (maxVal + 1);
        buckets[bucketIndex].push_back(arr[i]);
    }

    // Sort each bucket using Bubble Sort
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < buckets[i].size(); j++) {
            for (int k = 0; k < buckets[i].size() - 1; k++) {
                if (buckets[i][k] > buckets[i][k + 1]) {
                    int temp = buckets[i][k];
                    buckets[i][k] = buckets[i][k + 1];
                    buckets[i][k + 1] = temp;
                }
            }
        }
    }

    // Merge buckets back into array
    int index = 0;
    for (int i = 0; i < n; i++) {
        for (int val : buckets[i]) {
            arr[index++] = val;
        }
    }
}

void printArray(int arr[], int n) {
    for (int i = 0; i < n; i++)
        cout << arr[i] << " ";
    cout << endl;
}

int main() {
    int arr[] = {42, 32, 33, 52, 37, 47, 51};
    int n = sizeof(arr) / sizeof(arr[0]);

    cout << "Before sorting: ";
    printArray(arr, n);

    bucketSort(arr, n);

    cout << "After sorting:  ";
    printArray(arr, n);

    return 0;
}

